// src/App.jsx
import Accueil from './pages/Home/Accueil';
import Home from './pPages/Home/Home';
import Login from './Pages/Auth/Login';
import Register from './pages/Auth/Register';
import DetailOffre from './pages/Offre/DetailOffre';
import Postuler from './Pages/Offre/Postuler';
import Candidature from './pages/Offre/Candidature';
import DashboardAdmin from './pages/Dashboard/DashboardAdmin';
import DashboardEntreprise from './pages/Dashboard/DashboardEntreprise';
import DashboardMinistere from './pages/Dashboard/DashboardMinistere';
import Navbar from './omponents/Navbar';
import Logout from './components/Logout';


function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Authentification */}
        <Route path="/" element={<Home />} />
        <Route path="/register" element={<Register />} />

        {/* Dashboards par rôle */}
        <Route path="/dashboard/admin" element={<DashboardAdmin />} />
        <Route path="/dashboard/ministere" element={<DashboardMinistere />} />
        <Route path="/dashboard/entreprise" element={<DashboardEntreprise />} />
        <Route path="/offre/:id" element={<OffreDetail />} />
        <Route path="/mes-candidatures" element={<MesCandidatures />} />

        {/* Page d’accueil */}
        <Route path="/login" element={<Login />} />

        {/* Redirection si route inconnue */}
        <Route path="*" element={<Navigate to="/home" replace />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
